INSERT INTO `communication_log` VALUES (1,46,1589,10,1,'dgshor+4@gmail.com','Your Test(s) Have Shipped!','<table style=\"margin: 0 auto; width: 100%; max-width: 600px; border-spacing: 0; color: black; background: #fff; border: 0px solid #eee;\" width=\"100%\">\r\n<tbody>\r\n<tr>\r\n<td style=\"padding: 0px;\" width=\"100%\">\r\n<table style=\"border: 0px solid #eee; min-width: 340px;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr style=\"display: block; width: 100%;\">\r\n<td style=\"padding: 5px; text-align: center; display: block; width: 100%;\" width=\"100%\"><a href=\"https://staging.diagnostic.ly/\"><img src=\"https://stagingwp.diagnostic.ly/wp-content/uploads/2024/02/diag-wp-logo.png\" alt=\"Diagnostic.ly\" width=\"250px\" /></a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<table style=\"padding: 15px 5vw; text-align: center;\" width=\"100%\">\r\n<tbody>\r\n<tr>\r\n<td align=\"center\" width=\"100%\"><span style=\"color: #5a9c2e; line-height: 20px; display: block; margin-top: 0px;\"> <strong style=\"font-size: 18px; line-height: 25px; font-weight: bold; color: #5a9c2e;\">Hello David,</strong> </span></td>\r\n</tr>\r\n<tr>\r\n<td align=\"center\" width=\"100%\"><span style=\"color: #5a9c2e; line-height: 20px; display: block; margin-top: 10px;\"> <strong style=\"font-size: 22px; line-height: 25px; font-weight: bold; color: #5a9c2e;\">Your COVID-19 Tests have shipped.</strong> </span></td>\r\n</tr>\r\n<tr>\r\n<td align=\"center\" width=\"100%\"><span style=\"color: #000; line-height: 20px; display: block; margin-top: 10px;\"> <strong style=\"font-size: 15px; line-height: 25px; font-weight: 400; color: #000;\">Paul Javier has sent you this message to notify you that 1 COVID test(s) have been shipped to you via {shipper_type} {shipping_method} to the address provided:</strong> </span></td>\r\n</tr>\r\n<tr>\r\n<td align=\"center\" width=\"100%\"><span style=\"color: #000; line-height: 20px; display