INSERT INTO `observation_screens` VALUES (86,18,1,'instructions','<div class=\"container-fluid\">\r\n<div class=\"banner-wrap\">\r\n<div class=\"container\">\r\n<h1 class=\"banner-title\">Menopause Test</h1>\r\n</div>\r\n</div>\r\n<div class=\"about-sec\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col\">\r\n<div class=\"about-img\"><img src=\"../assets/static/about-us-img.jpg\" alt=\"Picture\"></div>\r\n</div>\r\n<div class=\"col\">\r\n<div class=\"about-info\">\r\n<h2>About This Test</h2>\r\n<p class=\"large\">This test detects follicle stimulating hormone (FSH) levels that are predictive of a woman&rsquo;s progress toward menopause. It will provide an indication as to whether you are in perimenopause, the period leading up to menopause. Normally menopause itself is not diagnosed until a year after the final cessation of menstrual cycles, so this test is helpful to know if you are in the perimenopause phase leading up to menopause.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<a class=\"theme-btn auto\" href=\"#\">Start Test</a></div>\r\n</div>\r\n<div class=\"start-sec\">\r\n<div class=\"container\">\r\n<h2>When to Start Testing</h2>\r\n<div class=\"row start-row\">\r\n<div class=\"col\">\r\n<div class=\"start-info\">\r\n<div class=\"start-icon\"><img src=\"../assets/static/test-icon1.svg\" alt=\"icons\"></div>\r\n<p>A first morning urine specimen is preferred since it generally contains the highest concentration of FSH, but any time of day is acceptable. (If you have unexpectedly cloudy urine, contact your medical provider and wait until the condition passes to take the test.)</p>\r\n</div>\r\n</div>\r\n<div class=\"col\">\r\n<div class=\"start-info centered-info\">\r\n<div class=\"start-icon\"><img src=\"../assets/static/test-icon2.svg\" alt=\"icons\"></div>\r\n<p>If you are still having monthly periods, take the first test during the first week of your cycle (days 2-7, with day 1 being the first day of menstruation.) If the result is negative but symptoms persist, repeat with the second test one week later.</p>\r\n</div>\r\n</div>\r\n<div class=\"col\">\r\n<div class=\"start-info\">\r\n<div class=\"start-icon\"><img src=\"../assets/static/test-icon3.svg\" alt=\"icons\"></div>\r\n<p>If you are no longer having regular periods, take the test at any time during the month and repeat with the second test 1 week later.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"stored-sec\">\r\n<div class=\"container\">\r\n<div class=\"row align-center\">\r\n<div class=\"col left\">\r\n<div class=\"stored-info\">\r\n<h2>Have You Stored Your Test Properly<br>Before Testing?</h2>\r\n<p>Store as packaged at room temperature or refrigerated <strong>35.6-86‚Ñâ (2-30‚ÑÉ).</strong> The test is stable through the expiration date printed on the sealed pouch. The test must remain in the sealed pouch until use. DO NOT FREEZE. Do not use beyond the expiration date.</p>\r\n</div>\r\n</div>\r\n<div class=\"col right\">\r\n<div class=\"stored-img\"><img src=\"../assets/static/stored-img.png\" alt=\"pictuer\"></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"precaution-sec\">\r\n<div class=\"container\">\r\n<h2 class=\"precaution-title\">Other Precautions</h2>\r\n<div class=\"row precaution-row\">\r\n<div class=\"col\">\r\n<div class=\"precaution-box\">\r\n<div class=\"precaution-img img-1\"><img src=\"../assets/static/icon1.svg\" alt=\"icon\"></div>\r\n<p>For external use only. Do not insert inside the body.</p>\r\n</div>\r\n</div>\r\n<div class=\"col\">\r\n<div class=\"precaution-box\">\r\n<div class=\"precaution-img img-2\"><img src=\"../assets/static/icon2.svg\" alt=\"icon\"></div>\r\n<p>Do not use after the expiration date.</p>\r\n</div>\r\n</div>\r\n<div class=\"col\">\r\n<div class=\"precaution-box\">\r\n<div class=\"precaution-img img-3\"><img src=\"../assets/static/icon3.svg\" alt=\"icon\"></div>\r\n<p>Do not open the foil pouch until you are ready to start the test.</p>\r\n</div>\r\n</div>\r\n<div class=\"col\">\r\n<div class=\"precaution-box\">\r\n<div class=\"precaution-img img-4\"><img src=\"../assets/static/icon4.svg\" alt=\"icon\"></div>\r\n<p>Do not use if the pouch is torn or damaged.</p>\r\n</div>\r\n</div>\r\n<div class=\"col\">\r\n<div class=\"precaution-box\">\r\n<div class=\"precaution-img img-5\"><img src=\"../assets/static/icon5.svg\" alt=\"icon\"></div>\r\n<p>Keep out of the reach of children.</p>\r\n</div>\r\n</div>\r\n<div class=\"col\">\r\n<div class=\"precaution-box\">\r\n<div class=\"precaution-img img-6\"><img src=\"../assets/static/icon6.svg\" alt=\"icon\"></div>\r\n<p>Use the test only once.</p>\r\n</div>\r\n</div>\r\n<div class=\"col\">\r\n<div class=\"precaution-box\">\r\n<div class=\"precaution-img img-7\"><img src=\"../assets/static/icon7.svg\" alt=\"icon\"></div>\r\n<p>The used test should be discarded in accordance with your local regulations.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"menopause-sec\">\r\n<div class=\"row menopause-row align-center\">\r\n<div class=\"col\">\r\n<div class=\"menopause__img\"><img src=\"../assets/static/about-menupause-img.png\" alt=\"\"></div>\r\n</div>\r\n<div class=\"col\">\r\n<div class=\"menopause__info\">\r\n<h2>About Menopause <br><em>and </em><strong> Perimenopause</strong></h2>\r\n<p class=\"large\">Menopause is the permanent cessation of menstruation, and perimenopause is the period leading up to menopause. Perimenopause can last several years and can have a wide variety of symptoms, the most common of which are hot flashes, irregular periods, sleep disorders, vaginal dryness, mood swings and fatigue among other symptoms. These symptoms arise from changing hormone levels such as a reduction in estrogen. During perimenopause, the body begins to produce more FSH to continue to stimulate the reproductive system.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"guide-sec\">\r\n<div class=\"row guide-row align-center\">\r\n<div class=\"col guide-info-col\">\r\n<div class=\"guide__img\"><img src=\"../assets/static/guide-img.jpg\" alt=\"\"></div>\r\n</div>\r\n<div class=\"col\">\r\n<div class=\"guide__info\">\r\n<h2>Guidance for <br>Self-Care During<br>Perimenopause</h2>\r\n<p class=\"large\">After taking the test, you will be provided information on self-care during perimenopause.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','',0,0,0,0,'','','','',0,0,0,0,'2024-05-14 11:50:37','2024-09-18 10:48:03'),(87,18,2,'video','<div class=\"container-fluid\">\r\n<div class=\"video-sec\">\r\n<div class=\"container\">\r\n<div class=\"row align-center\">\r\n<div class=\"col left\">\r\n<div class=\"video-title\">\r\n<h2>Menopause Test</h2>\r\n<h3>Take Your Test</h3>\r\n</div>\r\n</div>\r\n<div class=\"col right\">\r\n<div class=\"video\"><iframe title=\"YouTube video player\" src=\"https://www.youtube.com/embed/yRqP3DKOzwI?si=UqFAVos41YdDX925\" width=\"560\" height=\"315\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen=\"allowfullscreen\" referrerpolicy=\"strict-origin-when-cross-origin\"></iframe></div>\r\n</div>\r\n</div>\r\n<div class=\"video-features\">\r\n<div class=\"row\">\r\n<div class=\"col left\">\r\n<div class=\"video-feature\">\r\n<h4>Materials Provided</h4>\r\n<ul>\r\n<li>Test Midstream (2 or more tests)</li>\r\n<li>Package insert</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class=\"col right\">\r\n<div class=\"video-feature\">\r\n<h4>Materials Required but Not Provided</h4>\r\n<ul>\r\n<li>Clean &amp; dry urine containers</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"steps-sec\">\r\n<div class=\"container\">\r\n<h2>How to Take Your Test</h2>\r\n<p class=\"large\">Read below and watch the video for complete information on the steps involved in taking this test:</p>\r\n<div class=\"row steps-row\">\r\n<div class=\"col steps-col\">\r\n<div class=\"step-info\">\r\n<div class=\"step-icon\">\r\n<div class=\"step-number\">1</div>\r\n<img src=\"../assets/static/step1.svg\" alt=\"icon\"></div>\r\n<p>Make sure it is the right day to begin testing as referenced on the prior screen under &ldquo;When to Start Testing.&rdquo;</p>\r\n</div>\r\n</div>\r\n<div class=\"col steps-col\">\r\n<div class=\"step-info\">\r\n<div class=\"step-icon\">\r\n<div class=\"step-number\">2</div>\r\n<img src=\"../assets/static/step2.svg\" alt=\"icon\"></div>\r\n<p>Prepare a clean and dry cup into which you will urinate while sitting ‚Ä®on the toilet.</p>\r\n</div>\r\n</div>\r\n<div class=\"col steps-col\">\r\n<div class=\"step-info\">\r\n<div class=\"step-icon\">\r\n<div class=\"step-number\">3</div>\r\n<img src=\"../assets/static/step3.svg\" alt=\"icon\"></div>\r\n<p>Urinate in the cup and set on a clean surface (or you may skip this step and place the test midstream in your urine after step 6 below).</p>\r\n</div>\r\n</div>\r\n<div class=\"col steps-col\">\r\n<div class=\"step-info\">\r\n<div class=\"step-icon\">\r\n<div class=\"step-number\">4</div>\r\n<img src=\"../assets/static/step4.svg\" alt=\"icon\"></div>\r\n<p>Wash and dry<br>your hands.</p>\r\n</div>\r\n</div>\r\n<div class=\"col steps-col step-five\">\r\n<div class=\"step-info\">\r\n<div class=\"step-number\">5</div>\r\n<p class=\"text-left\">If you wish to record a video of how you conduct the test so that a health care provider can validate your collection method and results, scroll down and start the video by pressing the record button. The video will be uploaded and reviewed a short time later by a qualified healthcare professional.</p>\r\n</div>\r\n</div>\r\n<div class=\"col steps-col align-self-center\">\r\n<div class=\"step-info\">\r\n<div class=\"step-icon\"><img src=\"../assets/static/rec-icon.svg\" alt=\"Rec\"></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"steps-bg\"><img src=\"../assets/static/steps-bg.svg\" alt=\"Picture\"></div>\r\n</div>\r\n<div class=\"more-steps-sec\">\r\n<div class=\"container\">\r\n<div class=\"more-step step-6\">\r\n<div class=\"more-step-inner\">\r\n<div class=\"step-number\">6</div>\r\n<div class=\"more-step__img\"><img src=\"../assets/static/step6.jpg\" alt=\"picture\"></div>\r\n<p>Bring the foil test pouch to room temperature before opening it if you have previously refrigerated (but not frozen) it.</p>\r\n<div class=\"indicator-img indicator-1\"><img src=\"../assets/static/step-indictor1.svg\" alt=\"picture\"></div>\r\n</div>\r\n</div>\r\n<div class=\"more-step step-7\">\r\n<div class=\"more-step-inner\">\r\n<div class=\"step-number\">7</div>\r\n<div class=\"more-step__img\"><img src=\"../assets/static/step7.png\" alt=\"picture\"></div>\r\n<p>Remove the test from the sealed pouch.</p>\r\n<div class=\"indicator-img indicator-2\"><img src=\"../assets/static/step-indictor6.svg\" alt=\"picture\"></div>\r\n</div>\r\n</div>\r\n<div class=\"more-step step-8\">\r\n<div class=\"more-step-inner\">\r\n<div class=\"step-number\">8</div>\r\n<div class=\"more-step__img\"><img src=\"../assets/static/step8.png\" alt=\"picture\"></div>\r\n<p>Remove the test from the sealed pouch.</p>\r\n<div class=\"indicator-img indicator-3\"><img src=\"../assets/static/step-indictor1.svg\" alt=\"picture\"></div>\r\n</div>\r\n</div>\r\n<div class=\"more-step step-9\">\r\n<div class=\"more-step-inner\">\r\n<div class=\"step-number\">9</div>\r\n<div class=\"more-step__img\"><img src=\"../assets/static/step9.png\" alt=\"picture\"></div>\r\n<p>Hold the absorbent tip in the cup for at least 20 seconds. Use a timer if needed. DO NOT ALLOW URINE PAST THE ARROW OR TO FLOOD THE TEST WINDOW.</p>\r\n<div class=\"indicator-img indicator-2\"><img src=\"../assets/static/step-indictor6.svg\" alt=\"picture\"></div>\r\n</div>\r\n</div>\r\n<div class=\"more-step step-10\">\r\n<div class=\"more-step-inner\">\r\n<div class=\"step-number\">10</div>\r\n<div class=\"more-step__img\"><img src=\"../assets/static/step10.png\" alt=\"picture\"></div>\r\n<p>Replace the cap on the test, place the test on a clean level surface with the Test (T) and Control (C) line window facing upwards, then start the timer immediately.</p>\r\n<div class=\"indicator-img indicator-5\"><img src=\"../assets/static/step-indictor3.svg\" alt=\"picture\"></div>\r\n</div>\r\n</div>\r\n<div class=\"more-step step-11\">\r\n<div class=\"more-step-inner\">\r\n<div class=\"step-number\">11</div>\r\n<div class=\"more-step__img\"><img src=\"../assets/static/step11.png\" alt=\"picture\"></div>\r\n<p>Wait 8 minutes then review the test result.</p>\r\n<div class=\"indicator-img indicator-2\"><img src=\"../assets/static/step-indictor6.svg\" alt=\"picture\"></div>\r\n</div>\r\n</div>\r\n<div class=\"more-step step-12\">\r\n<div class=\"more-step-inner\">\r\n<div class=\"step-number\">12</div>\r\n<div class=\"more-step__img\"><img src=\"../assets/static/step12.png\" alt=\"picture\"></div>\r\n<p>If there is no line, your urine sample was not collected properly or your test was defective. Click Get Support if you have any questions.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"collection-quality-sec\">\r\n<div class=\"container\">\r\n<div class=\"collection-quality\">\r\n<h2>Confirm Your Collection Quality and Results for Free by Recording the Video</h2>\r\n<p>If you are urinating onto the test device directly, do not record a video.</p>\r\n<a class=\"theme-btn auto\" href=\"#\">Skip</a></div>\r\n</div>\r\n</div>\r\n</div>','none',5,0,15,0,'custom','custom','What do you think your result is?','Positive;Negative;Inconclusive',0,0,0,0,'2024-05-14 11:50:37','2024-09-18 10:48:58'),(88,18,3,'photo','<div class=\"container-fluid\">\r\n<div class=\"photo-sec\">\r\n<div class=\"container\">\r\n<h2>Confirm Your Collection Quality and Results for Free</h2>\r\n<a class=\"theme-btn auto\" href=\"#\">Skip</a>\r\n<h3>Take a Photo of Your Test Result</h3>\r\n<div class=\"row align-center\">\r\n<div class=\"col left\">\r\n<div class=\"photo-sec__img\"><img src=\"../assets/static/camra-icon.png\" alt=\"Pictuer\"></div>\r\n</div>\r\n<div class=\"col right\">\r\n<div class=\"photo-sec__info\">\r\n<h4>How to Take a Photo</h4>\r\n<ul>\r\n<li>1. Place the test in front of your device&rsquo;s camera and ensure that the image is in focus.</li>\r\n<li>2. Click the Take Photo button.</li>\r\n<li>3. Click the Next button at the bottom of the screen.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','',0,0,0,0,'','','','',0,0,0,0,'2024-05-14 11:50:37','2024-09-18 10:50:20'),(89,18,4,'wrap-up','<div class=\"container-fluid\">\r\n<div class=\"congratulation-sec\">\r\n<div class=\"container\">\r\n<h2>Congratulations on Completing your Test</h2>\r\n<a class=\"theme-btn\" href=\"#\">Finished</a>\r\n<h3>Are You in Perimenopause?</h3>\r\n<p class=\"large\">If your test result shows that you are perimenopausal, you can take appropriate steps to keep your body healthy and avoid the health risks associated with menopause, which include osteoporosis, increased blood pressure and cholesterol and increased risk of heart disease.</p>\r\n<p class=\"large\">First, contact your healthcare provider to discuss what you can do to keep yourself healthy during perimenopause and menopause. Some resources for your reading:</p>\r\n<p class=\"large\"><a href=\"https://www.nia.nih.gov/health/menopause/staying-healthy-during-and-after-menopause\">Staying Healthy During and After Menopause</a></p>\r\n<p class=\"large\"><a href=\"https://www.youtube.com/watch?v=Q_7HvF56Ptg\">Lifestyle Changes to Help Manage Menopause</a></p>\r\n</div>\r\n</div>\r\n</div>','',0,0,0,0,'','','','',0,1,0,0,'2024-05-14 11:50:37','2024-09-18 10:51:12'),(90,18,5,'none','<div class=\"container continermaxwidth\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12 mob-padding\">\r\n<h1 class=\"text-center\">At-home Rapid Antigen COVID-19 Test<br />Instructions and Observations</h1>\r\n<div class=\"subcontent\">\r\n<h2 class=\"texttransform\">Congratulations.</h2>\r\n<h3>The Test and Observation Process is Now Complete</h3>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"container continermaxwidth\">\r\n<div class=\"row display-flex\">\r\n<div class=\"col-sm-12 padding-0\">\r\n<div class=\"wraparound v3\">\r\n<p>Current Status</p>\r\n<ul class=\"arrowlist\">\r\n<li><img src=\"../assets/1/images/arrow.png\" />&nbsp;Your personal information&nbsp;<strong>successfully uploaded.</strong></li>\r\n<li><img src=\"../assets/1/images/arrow.png\" />&nbsp;Video observation&nbsp;<strong>successfully uploaded.</strong></li>\r\n<li><img src=\"../assets/1/images/arrow.png\" />&nbsp;Photo of test result&nbsp;<strong>successfully uploaded.</strong></li>\r\n</ul>\r\n<p>Proper Disposal of Test Materials:</p>\r\n<ul>\r\n<li><strong>Dispose of used contents as biohazardous waste</strong>&nbsp;in accordance with Federal, State, and Local requirements.</li>\r\n</ul>\r\n<p>What to expect next:</p>\r\n<ul>\r\n<li>Your video and photo will be&nbsp;<strong>reviewed within 24 hours.</strong></li>\r\n<li>You will receive a&nbsp;<strong>text</strong>&nbsp;message and&nbsp;<strong>email</strong>&nbsp;with your test results.</li>\r\n</ul>\r\n<img class=\"img-responsive positionfixedbottom\" src=\"../assets/1/images/Phone.png\" /></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"container\" style=\"padding-bottom: 60px;\">\r\n<div class=\"row\">\r\n<div class=\"col-md-3 col-sm-6 col-md-push-7 col-sm-push-4\"><a class=\"classbtn btn-width-100\" href=\"#\">Close Window</a></div>\r\n</div>\r\n</div>','',0,0,0,0,'','','','',0,0,0,0,'2024-05-14 11:50:37','2024-09-18 10:50:20'),(91,19,1,'instructions',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,0,'2024-09-14 18:04:37',NULL),(92,19,2,'video',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,0,'2024-09-14 18:04:37',NULL),(93,19,3,'wrap-up',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,0,'2024-09-14 18:04:37',NULL),(94,19,4,'none',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,0,'2024-09-14 18:04:37',NULL),(95,19,5,'none',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,0,'2024-09-14 18:04:37',NULL);
